import React, { Component } from 'react'


const boxStyles = {
    padding: '0.5em',
    margin: ' 0.5em',
    border: '1px solid gray',
    borderRadius: '0.3em',
    textAlign: 'center'
}

class List extends Component {
    render() {
        const { list, render } = this.props

        return (
            <div>
                {list.map((item, index) => {

                    if (render) {
                        return render(item, index)
                    }

                    return (
                        <li key={item.name}>
                            { item.name}
                        </li>
                    )
                })}
            </div>
        )
    }
}

export default class Servicios extends Component {
    state = {
        fruits: [
            { name: 'Fresa', price: 22 },
            { name: 'Mango', price: 18 },
            { name: 'Sandia', price: 24 },
            { name: 'Manzana', price: 12 },
        ]
    }

    render() {
        const { fruits } = this.state
        return (
            <div style={boxStyles}>
                <List
                    list={fruits}
                />
            </div>
        )
    }
}
